import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';  // Import Routes instead of Switch
import Login from './components/Login';
import Register from './components/Register';
import Logout from './components/Logout';

function App() {
  return (
    <Router>
      <div>
        <h1>Welcome to the Electric Vehicles Charging System</h1>
        <Routes>  {/* Replace Switch with Routes */}
          <Route path="/login" element={<Login />} />  {/* Replace component with element */}
          <Route path="/register" element={<Register />} />  {/* Replace component with element */}
          <Route path="/logout" element={<Logout />} />  {/* Replace component with element */}
          <Route path="/" element={<Home />} />  {/* Add Home component here */}
        </Routes>
      </div>
    </Router>
  );
}

// Optional: Create a Home component for the "/" path
function Home() {
  return (
    <>
      <h2>Home</h2>
      <p>Welcome to our electric vehicle charging station management system!</p>
    </>
  );
}

export default App;
